import React from "react";
import './PersonalInfo.css'

function PersonalInfo() {
    return (
        <div className="PersonalInfo">
            <h1 className="PersonalInfo-from">Personal Info</h1>
            <h3 className="PersonalInfo-from">FirstName:</h3>
            <input type="text" className="PersonalInfo-from" />
            <h3 className="PersonalInfo-from">Last Name:</h3>
            <input type="text" className="PersonalInfo-from"/><br/>
            <input type="submit"/>
        </div>
    );
}

export default PersonalInfo
